package com.wml.springboot.auth.entity;/** * 菜单 * <pre> * <b>Title：</b>Menu.java<br/> * <b>@author：</b>WML<br/> * <b>@date：</b>2016年11月9日 - 上午9:15:14<br/>   * <b>@version V1.0</b></br/> * <b>Copyright (c) 2016 ASPire Tech.</b>    * </pre> */public class Menu extends BaseEntity {	private static final long serialVersionUID = -6380192975770195471L;		/**	 * 菜单id	 */	private Long menuId;		/**	 * 菜单名称	 */	private String menuName;		/**	 * 菜单key	 */	private String menuKey;		/**	 * 父级id	 */	private Long parentId;		/**	 * 图标地址	 */	private String imageUrl;		/**	 * 访问url	 */	private String url;		/**	 * 排序顺序	 */	private String menuOrder;		/**	 * 子系统名称	 */	private String subsystem;		/**	 * 菜单所属域（admin、sp）	 */	private String domain;	public Long getMenuId() {		return this.menuId;	}	public void setMenuId(Long menuId) {		this.menuId = menuId;	}	public String getMenuName() {		return this.menuName;	}	public void setMenuName(String menuName) {		this.menuName = menuName;	}	public String getMenuKey() {		return this.menuKey;	}	public void setMenuKey(String menuKey) {		this.menuKey = menuKey;	}	public Long getParentId() {		return this.parentId;	}	public void setParentId(Long parentId) {		this.parentId = parentId;	}	public String getImageUrl() {		return this.imageUrl;	}	public void setImageUrl(String imageUrl) {		this.imageUrl = imageUrl;	}	public String getUrl() {		return this.url;	}	public void setUrl(String url) {		this.url = url;	}	public String getMenuOrder() {		return this.menuOrder;	}	public void setMenuOrder(String menuOrder) {		this.menuOrder = menuOrder;	}	public String getSubsystem() {		return this.subsystem;	}	public void setSubsystem(String subsystem) {		this.subsystem = subsystem;	}	public String getDomain() {		return this.domain;	}	public void setDomain(String domain) {		this.domain = domain;	}	@Override	public String toString() {		return "Menu [menuId=" + menuId + ", menuName=" + menuName				+ ", menuKey=" + menuKey + ", parentId=" + parentId				+ ", imageUrl=" + imageUrl + ", url=" + url + ", menuOrder="				+ menuOrder + ", subsystem=" + subsystem + ", domain=" + domain				+ "]";	}	}